INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3596710425273', 'Sweet Burger Chocolat', 'Mousse chocolat (44,6 %) : crème pasteurisée (crème (contient _lait_), stabilisant : carraghénanes), chocolat noir à 50 % de cacao 9 % (pâte de cacao, sucre, beurre de cacao, émulsifiant : lécithine de _soja_, arôme vanille), blancs d\'_œuf_ (stabilisant : gomme xanthane), chocolat noir à 70 % de cacao 3 % (pâte de cacao, sucre, beurre de cacao, émulsifiant : lécithine de _soja_, arôme vanille), beurre (contient _lait_), sucre, pâte de cacao. Pâte à brioche (27,7 %) : farine de blé (farine de blé (contient _gluten_), _gluten_ de blé), _lait_ demi-écrémé, _œufs_ entiers pasteurisés, beurre (contient _lait_), sucre, préparation pour pâte (farine de blé (contient _gluten_), poudre de blanc d\'_œuf_, levure désactivée, _gluten_ de blé, poudre de _lait_ écrémé, agent de traitement de la farine : acide ascorbique), graines de _sésame_, levure, sel. Glaçage cacao (13,4 %) : sucre, eau, crème pasteurisée (crème (contient _lait_, stabilisant : carraghénanes), sirop de glucose de maïs, glaçage (sirop de glucose-fructose, eau, humectant : glycérol, sucre, épaississant : pectine, correcteurs d\'acidités : acide citrique et citrate de sodium), cacao en poudre 1 %, gélatine bovine, épaississant : pectine, stabilisants : diphosphate disodique, phosphate tricalcique. Plaque chocolat blanc (10,7 %) : chocolat blanc (sucre, beurre de cacao, poudre de _lait_ entier, poudre de _lait_ écrémé, émulsifiant : lécithine de _soja_, arôme de vanille). Glaçage framboise (1,8 %) : glaçage (sirop de glucose-fructose, eau, humectant : glycérol, sucre, épaississant : pectine, correcteurs d\'acidité : acide citrique et citrate de sodium), eau, nappage (sirop de glucose-fructose, sucre, eau, abricot, gélifiant : pectines, acidifiants : acide citrique, phosphates de potassium), purée de framboises 0,1 %, sucre, concentré végétal (concentré de radis, pomme, cassis), épaississant : pectine, stabilisants : diphosphate disodique, phosphate tricalcique, arôme naturel de framboise. Crème beurre (1,8 %) : beurre (contient _lait_), fondant (sucre, sirop de glucose de blé, eau), concentré végétal (concentré de spiruline, carthame, citron et pomme).', 'https://static.openfoodfacts.org/images/products/359/671/042/5273/front_fr.6.400.jpg', '18.8', '12.4', '42.6', '22.9', '', '6.4', '0.42', '0.165354330708661', '', '1');

