au), concentré végétal (concentré de spiruline, carthame, citron et pomme).', 'https://static.openfoodfacts.org/images/products/359/671/042/5310/front_fr.6.400.jpg', '13.9', '9.4', '35.3', '23', '', '4.7', '0.38', '0.149606299212598', '', '1');

